(byte, byte, byte, byte) Split(uint u) {
    return (
(byte)((u & 0xFF000000) >> 24),
(byte)((u & 0x00FF0000) >> 16),
(byte)((u & 0x0000FF00) >> 8),
(byte)(u & 0x000000FF)
    );
}

uint Combine(byte x, byte y, byte z, byte w) {
    return ((uint)x) << 24 | ((uint)x) << 16 | ((uint)x) << 8 | (uint)w;
}

uint ArgbToABGR((byte a, byte r, byte g, byte b) argb) { 
    return Combine(argb.a, argb.b, argb.g, argb.r);
}
uint[] Convert(uint[] argb, Func<(byte, byte, byte, byte), uint> f) {
    return argb.Select(x => f(Split(x))).ToArray();
}

void Print(string name, uint w, uint h, uint[] array) {
    StringBuilder sb = new();
    sb.AppendLine($"// {w} x {h}");
    sb.AppendLine($"const {name.ToUpperInvariant()}: [u32;{w*h}] = [");
    sb.Append("    ");
    foreach(var i in array) {
sb.Append($"0x{i:X8},");
    }
    sb.AppendLine();
    sb.AppendLine("];");
    Console.WriteLine(sb.ToString());
}

